import styled from "styled-components";

export const UserProfileWrapper = styled.form`
    margin-top: 6px;
    margin-left: 6px;
    padding-top: 6px;
    padding-left: 8px;
    padding-right: 8px;
    padding-bottom: 10px;
    border: 1px solid gray;
    border-radius: 5px;
`
